define(['jquery'],function($){var module={};module.fixTooltipFocus=function(){var messages;$('[data-toggle="popover"]').each(function(index,messages){messages[index]=$(this).attr('data-content');var el=$(this);el.attr('data-content','');el.on('focus',function(e){var code=(e.keyCode?e.keyCode:e.which)});el.on('mousedown',function(e){el.attr('data-content',messages[index])});el.keydown(function(e){el.attr('data-content','');if(e.keyCode===27){el.attr('data-content','');el.blur()}else if(e.keyCode===13){el.attr('data-content',messages[index]);el.blur();el.focus()}else if(e.keyCode==9||(e.shiftKey&&e.keyCode==9)){el.attr('data-content','')}})})};return module})